const Service = () => {
  return (
    <>
      <div>
        <h1 className=' text-center mt-5 my-3'>Our Services</h1>
      </div>
      <div className="container-fluid">
    <div className=" row ">
    <div className="col-10 mx-auto">
    <div className="row">
   {CardData.map((val,i)=>{
     return(
      <div className="col-lg-4 col-md-5 col-10 mx-auto gy-3">
